bool containsDuplicate(int* nums, int numsSize){
    bool answer = false;
    for(int i = 0; i < numsSize-1; i++){
        for(int j=i+1; j < numsSize; j++){
            if(nums[i] == nums[j]){
                printf("%d\n", nums[i]);
                answer=true;
            }
        }
    }
    
    return answer;
}

